INSERT INTO `news` (`id`, `news_icon`, `news_title`, `news_content`, `news_date`) VALUES
(6, 'instagram', 'Novo painel', 'Esse é o novo painel, nosso antigo painel passou por uns problemas e com isso\r\nperdemos todos os nosso clientes por causa de pessoas mal\r\npeço a todos desculpas...', '2022-04-24 14:45:11'),
(7, 'duyuru', 'NOVIDADES ', 'GRANDES MUNDANÇAS COM OS MELHORES PREÇOS DO MERCADO\r\nAGORA COM DUAS FORMAS DE PAGAMENTO PIX E MERCADO PAGO\r\nGANHE DINHEIRO INDICANDO NOSSO PAINEL GANHE 10% \r\n\r\nSOMOS OS MAIORES PROVEDORES DO BRASIL COM  SERVIÇOS ATUALIZADOS \r', '2022-04-28 16:41:24'),
(9, 'duyuru', '                                                    ATENÇÃO ', ' AVISO RÁPIDO \r\nPARA OS CLIENTES QUE NÃO TEM PAINEL PARA PUXAR NOSSA  API  E TER MAIS RESULTADOS VAMOS FAZER UM CURSO PARA  AUMENTAR  AS SUAS VENDAS \r\nCASO QUEIRA TER ESSE ACESSO COM OUTRAS NOVIDA CHAMAR  whatsapp..\r\nBOAS VEN', '2022-04-30 09:14:44'),
(10, 'instagram', 'ALTERAÇÃO DE PREÇOS', 'olá é muito importante que fique de olhos em cada serviços \r\ncom seus valores á qualquer momento pode mudar então fiquem a tentos... \r\nnota dia 2022/05/01', '2022-05-01 22:23:15'),
(11, 'duyuru', 'Atenção 2022/05/02', 'estamos passando por umas lentidão de serviços por isso ah demoras de entrega', '2022-05-02 12:43:18'),
(12, 'duyuru', 'PRMOÇÃO MALUCA  ATÉ  AS 21:00  ACABOU O TEMPO ', '1 HORA MALUCA  APROVEITE SÓ HOJE \r\n MUITO ATODOS  QUE APROVEITOU NOSSAQ PROMOÇÃO .', '2022-05-02 20:05:32'),
(13, 'duyuru', 'SERVIÇOS DE TIK TOK', 'OLÁ ESTAMOS TESTANDO UM NOVO SERVIÇO DE TIK TOK\r\nTRAZENDO MELHORIAS PARA TODOS OS REVENDEDORES\r\n \r\nServiço: 398 SEGUIDORES TIK TOK BOTS EM TESTE ....\r\nVALOR PARA REVENDEDORES R$ 0,40', '2022-05-04 02:14:16'),
(14, 'duyuru', 'ATENÇÃO REVENDEDORES ?', 'quem for revendedor e puxar nossa API ganha bónus de 5% colocando R$ 50,00 pra cima só para quem puxar API ....', '2022-05-05 12:04:25'),
(16, 'duyuru', 'ATENÇÃO', 'É COM MUITA TRISTEZA QUE VENHO FALAR QUE NOSSO PAINEL NÃO IRÁ MAIS FUCIONAR, TIVEMOS UMA NOVA INVASÃO EM FORMAS DE PAGAMENTO ONDE UMA PESSOA  MAL  ESTÁ PREJUDICANDO NOSSO SISTEMA E NÃO É SÓ ISSO AFETANDO TAMBÉM O DONO DO SITE', '2022-05-08 03:28:32'),
(17, 'duyuru', 'PAGAMENTO MANUAL POR FAVOR ', 'PEÇO QUE FAÇA O PAGAMENTO MANUAL POR SEGURANÇA DE NOSSO SITE..', '2022-05-08 15:01:02'),
(20, 'duyuru', 'PROBLEMAS DE ENTREGA ', 'ESTAMOS PASSANDO POR PROBLEMAS EM NOSSO PROVEDOR DE ENTREGA ', '2022-05-16 20:04:45');
